export const test = (C_B_L_P_R,C_B_R_P_R)=>{
	if(params.p_w > 31)
	{
		if(params.trussType == "ACDT" || params.trussType == "CTCT"){
			comercialTrusses(C_B_L_P_R,C_B_R_P_R);
		}else if(params.trussType == "QCT"){
			comercialTrussForQCT(C_B_L_P_R,C_B_R_P_R);
		}else if(params.trussType == "SBST"){
			comercialTrussForSBST(C_B_L_P_R,C_B_R_P_R);
		}else if(params.trussType == "ECT" || params.trussType == "LST" || params.trussType == "RNT" || params.trussType == "AST"){
			comercialTrussForECT(C_B_L_P_R,C_B_R_P_R);
		}
	}
	if(params.p_w >= 25)
	{
	    if(params.trussType == "CST"){
	    	comercialTrussForCS(C_B_L_P_R,C_B_R_P_R);
	    }
    }

	if (params.p_w >= 31 && (params.trussType == "ECT" || params.trussType == "LST")) comercialTrussForECT(C_B_L_P_R,C_B_R_P_R);
}
